import React from 'react';
import styled from 'styled-components'
import bg from './images/bg.jpg'
function App() {
    const Appstyled = styled.div`
        height: 100vh;
        background_image
    `
  return (
    <div className="App">
      <h1>Welcome to My React App</h1>
    </div>
  );
}

export default App;
